DROP TABLE PTVarijanteVR;
CREATE TABLE PTVarijanteVR
    (
        ID INT NOT NULL,
        VozniRedID INT NOT NULL REFERENCES PTVozniRedi(ID),
        Varijanta INT NOT NULL,
        Opis1 VARCHAR(80),
        Opis2 VARCHAR(80),
        DOSVarID INT,
        PRIMARY KEY(ID)
    ) ;
CREATE UNIQUE INDEX IX_PTVarijanteVR ON PTVarijanteVR (VozniRedID, Varijanta);
